const books = {};
feed.channel.item.forEach(item => {
   const title = item.title[0]
      .replace('LIVE ', '')
      .replace('Revelation_17', 'Revelation 17')
      .replace('Hebrews11:8-22', 'Hebrews 11:8-22')
      .replace('1Corinthians', '1 Corinthians')
      .replace('2Timothy', '2 Timothy');
   const mp3 = item.enclosure['@url'];
   const outline = mp3.substr(mp3.lastIndexOf('/') + 1).replace('.mp3', '.doc');
   const parts = title.split(' ');
   let bookName;
   let bookChapter;
   if(parts[0] === '1' || parts[0] === '2' || parts[0] === '3' || parts[0] === '4') {
      bookName = parts[0] + ' ' + parts[1];
      bookChapter = +(parts[2].split(':')[0]);
   } else {
      bookName = parts[0];
      bookChapter = +(parts[1].split(':')[0]);
   }

   const study = {
      title: title, 
      audio: mp3, 
      outline: outline
   }

   if (!books[bookName]) {
      books[bookName] = [];
      books[bookName][bookChapter - 1] = {
         chapter: bookChapter,
         studies: [study] 
      }
   } else {
      if(!books[bookName][bookChapter - 1]) {
         books[bookName][bookChapter - 1] = {
            chapter: bookChapter,
            studies: [study] 
         }
      }else{
         books[bookName][bookChapter - 1].studies.push(study);
      }
   }
});
// console.log(books);
fs.writeFile('data/books.js', `export default ${JSON.stringify(books, null, 2)}`, function(){console.log('done')});